import { useParams } from "react-router";
import "./styles.css";
import { useEffect } from "react";
import { AxiosRequestConfig } from "axios";
import { requestBackend } from "util/requests";
import { Link } from "react-router-dom";

type urlParams = {
  movieId: string
}

const MovieCatalog = () => {

  const {movieId} = useParams<urlParams>();
  const [page, setPage] = useState<MoviePage<Movies>>();

  useEffect(() => {
    const config: AxiosRequestConfig = {
      method : 'GET',
      url: '/movies',
      withCredentials: true,
      params: {
        page: 0,
        size: 12
      }
    }

    requestBackend(config)
    .then(response => {
      setPage(response.data)
    }) 
  }, [movieId])
  return (
    <>
      <div className="movie-catalog-container">
        <div className="movie-catalog-content">
          <h1>Tela de listagem de filmes</h1>
          <Link to='/movies/1'>Acessar /movies/1<br></br></Link>
          <Link to='/movies/2'>Acessar /movies/2</Link>
        </div>
      </div>
    </>
  );
};

export default MovieCatalog;
